				if (dline.length > 1)
					dlinePoly = L.polyline(dline, { color: 'green' }).addTo(map);
			}
		};

		lineEditBox.onAdd = function (map) {
			var div = L.DomUtil.create('div', 'leaflet-control-attribution');
			var p = document.createElement('p');
			p.appendChild(lineEdit);
			div.appendChild(p);
			return div;
		};

		lineEditBox.addTo(map);

		map.on('click', function (e) {
			dline[dline.length] = [e.latlng.lat.toFixed(2), e.latlng.lng.toFixed(2)];
			var t = "";
			for (var i = 0; i < dline.length; i++) {
				if (i > 0)
					t += ",";
				t += dline[i][0] + "," + dline[i][1];
			}
			lineEdit.value = t;
			if (dlinePoly)
				dlinePoly.removeFrom(map);
			dlinePoly = null;
			if (dline.length > 1)
				dlinePoly = L.polyline(dline, { color: 'green' }).addTo(map);
		});
	}

	var src = L.control({ position: 'bottomleft' });
	var cellSearch = document.createElement('input');
	cellSearch.type = "text";
	cellSearch.onkeydown = function (e) {
		if (e.key == 'Enter') {
			var coords = cells[this.value.toLowerCase()];
			if (coords) {
				var zoom = 7;
				if (coords.length == 3) {
					zoom = coords[2];
					coords = [coords[0], coords[1]];
				}
				if (coords.length == 4)
					map.fitBounds([[coords[0], coords[1]], [coords[2], coords[3]]]);
				else
					map.setView(coords, zoom);
			}
			this.value = "";
		}
	};

	src.onAdd = function (map) {
		var div = L.DomUtil.create('div', 'leaflet-control-attribution');
		var p = document.createElement('p');
		p.appendChild(cellSearch);
		div.appendChild(p);
		var p = document.createElement('p');
		p.innerHTML = "<a href=\"https://github.com/msinger/dmg_cpu_b_map/\">Source code on GitHub</a>";
		div.appendChild(p);
		return div;
	};

	src.addTo(map);

	var coord = L.control({ position: 'bottomleft' });
	var coordDiv = L.DomUtil.create('div', 'leaflet-control-attribution');
	coordDiv.innerHTML = "<p>&nbsp;</p>";
	coord.onAdd = function (map) { return coordDiv; };
	coord.addTo(map);

	map.on('mousemove', function (e) {
		coordDiv.innerHTML = "<p>" + e.latlng.lat.toFixed(2) + ", " + e.latlng.lng.toFixed(2) + "</p>";
	});

	var line = [];
	for (var i = 0; i < 32; i++) {
		var l = params.get("line[" + i + "]");
		if (l) {
			var p = l.split(",");
			if (p.length >= 4 && !(p.length & 1)) {
				line[i] = [];
				for (var j = 0; j < p.length; j += 2)
					line[i][j/2] = [p[j], p[j+1]];
				var b = L.polyline(line[i]).getBounds();
				cells['line[' + i + ']'] = [b.getSouthWest().lat, b.getSouthWest().lng, b.getNorthEast().lat, b.getNorthEast().lng];
			}
		}
	}

	var mark = [];
	for (var i = 0; i < 32; i++) {
		var m = params.get("mark[" + i + "]");
		if (m) {
			var p = m.split(",");
			var s = '';
			if (p.length == 3) {
				s = p[2];
				p = [p[0], p[1]];
			}
			if (p.length == 2) {
				mark[i] = { p: p, s: s };
				cells['mark[' + i + ']'] = p;
			}
		}
	}

	if (line.length > 0) {
		var b = L.polyline(line, { color: 'red' }).addTo(map).getBounds();
		L.polyline(line, { color: 'red' }).addTo(miniMap._miniMap);
		cells['line[]'] = [b.getSouthWest().lat, b.getSouthWest().lng, b.getNorthEast().lat, b.getNorthEast().lng];
	}

	for (var m of mark) {
		L.marker(m.p, { title: m.s }).addTo(map);
		L.marker(m.p, { title: m.s }).addTo(miniMap._miniMap);
	}

	var view = params.get("view");
	if (view) {
		var p = view.split(",");
		var z = 6;
		if (p.length == 1) {
			var coords = cells[p[0].toLowerCase()];
			if (coords) {
				z = 7;
				p = coords;
			}
		}
		if (p.length == 4)
			map.fitBounds([[p[0], p[1]], [p[2], p[3]]]);
		if (p.length == 3) {
			z = p[2];
			p = [p[0], p[1]];
		}
		if (p.length == 2)
			map.setView(p, z);
	}

	document.getElementById('map').style.cursor = 'crosshair'

</script>
</body>
</html>
